import React from 'react'
import './HeroSection.css'
import PlaceholderVideo from '../resources/videos/PlaceholderVideo.mp4';
import { Button } from "./Button";

function btn() {
}
function HeroSection() {
    return (
        <div className='hero-container'>
            <video src={PlaceholderVideo} autoPlay loop muted />
            <h1>WHERE STUFF HAPPENS</h1>
            <p>Join in the fun!</p>
            <div classname='hero-btns'>
                <Button
                    className='btns'
                    buttonStyle='btn--colHero'
                    buttonSize='btn--hero'>Join an Event!</Button>

                    <Button
                    className='btns'
                    buttonStyle='btn--colHero'
                    buttonSize='btn--hero'>Discover an Event!</Button>
            </div>
        </div>
    )
}
export default HeroSection
